  text-align: center;
  background-color: #16162d;
  padding: 2rem 0;
  position: relative;
}

.up {
  position: absolute;
  width: 5rem;
  height: 5rem;
  background-color: #eee;
  top: -2.5rem;
  right: 5rem;
  border-radius: 100%;
  display: flex;
  animation: pulse 2s infinite;
  cursor: pointer;
}

.up i {
  color: #16162d;
  font-size: 2rem;
  margin: auto;
}

.copyright p {
  font-size: 1.4rem;
}

/*End footer*/

/*Start animations*/
@keyframes pulse {
  0% {
    box-shadow: 0 0 0 0 rgba(253, 87, 191, 0.99);
  }

  70% {
    box-shadow: 0 0 0 2rem rgba(253, 87, 191, 0);
  }

  100% {
    box-shadow: 0 0 0 0 rgba(253, 87, 191, 0);
  }
}

/*End animations*/

/*Start media queries*/
@media screen and (max-width: 1035px) {
  .about-heading h1 {
    font-size: 5rem;
  }
}

@media screen and (max-width: 768px) {
  body {
    background: url("./images/hero2.png") no-repeat center fixed;
    background-size: cover;
  }

  .box1 {
    width: 15rem;
    height: 30rem;
    transform: translateY(-50px);
  }

  .box2 {
    width: 15rem;
    height: 30rem;
    transform: translateY(-80px);
  }

  .box1:hover .box2 {
    transform: translateY(0);
  }

  .box1:hover .box1 {
    transform: translateY(0px);
  }

  .landing-text h1 {
    font-size: 10rem;
  }

  .landing-text h6 {
    font-size: 1.7em;
  }

  .nav-list {
    flex-direction: column;
  }

  li {
    margin: 2rem 0;
  }

  .nav-link {
    font-size: 4.5rem;
  }

  .about-heading h1 {
    font-size: 5rem;
  }

  .section-heading h1 {
    font-size: 3rem;
  }

  .about-details .nav-list {
    flex-direction: initial;
  }

  .about-details li {
    margin: 0 2rem;
  }

  .icon-container {
    width: 7rem;
  }

  .icon-container i {
    font-size: 4rem;
  }

  .timeline ul {
    margin: 0 0 0 auto;
  }

  .timeline .date::before {
    left: -20rem;
  }

  .timeline .date::after {
    left: -5.9rem;
  }
}

@media screen and (max-width: 600px) {
  .menu-toggler {
    top: 2rem;
    right: 2rem;
  }

  .landing-text h1 {
    font-size: 8rem;
  }

  .landing-text h6 {
    font-size: 1.4rem;
  }

  .nav-link {
    font-size: 3.5rem;
  }

  .about .container {
    flex-direction: column;
  }

  .profile-img {
    margin: 0 0 7rem 0;
  }

  .portfolio-item {
    flex-direction: column;
  }

  .portfolio-img {
    margin: 0 0 2rem 0;
  }

  .portfolio-description {
    margin: 0;
    order: 2;
  }

  .timeline p {
    font-size: 1.6rem;
  }

  .timeline .date::before {
    font-size: 1.4rem;
  }

  form {
    width: 100%;
  }

  .up {
    right: 2rem;
  }
}

/* End media queries*/

