.close {
  position: relative;
  top: -10px;
  color: #aaa;
  margin: 10px;
  float: right;
  font-size: 28px;
  font-weight: bold;
}

.close:hover,
.close:focus {
  color: #eee;
  text-decoration: none;
  cursor: pointer;
}

.modal-content p {
  position: absolute;
  font-size: 3rem;
}

.modal_img {
